import React from 'react';

import Button from '../components'

import Container from './Container.js'
import SmallContainer from './SmallContainer.js'
import Header from './Header'
import H1 from './H1'

import P from './P'
import Input from './Input'
import Br from '../components/Br'
import ParallaxBackground from './ParallaxBackground'
import bgimg3 from '../assets/bgimg3.jpg'



class About extends React.Component {
	constructor(props) {
		super(props)
		this.state = {
			id: 0,
		}
	}

	render() {
		return(
			<Container>
				<ParallaxBackground bgimg={bgimg3}>					
					<Header width='420'>
						<H1 big>Create</H1>
						<Br></Br>
						<br></br>
						<P big>Don't be a stat sheet. Be a hero.</P>
					</Header>
				</ParallaxBackground>


				<SmallContainer width='100vw'>
				<Header width='280'>
					<H1 big>Create</H1>
					<Br></Br>
					<P big></P>
				</Header>
				</SmallContainer>
			</Container>
		);
	}

}

export default About;
